import React from 'react';
import { AppBar, Tabs, Tab } from '@material-ui/core';


export default function NavBar() {

  const NavStyle = {
    justifyContent: "center",
    color: "white",
    opacity:1,
    fontWeight:"bolder"
  }

  return (
    <div>
      <Tabs>
        <Tab label="Location" />
        <Tab label="Login" />
        <Tab label="Sign-up" />
      </Tabs>
